import React from "react";
import { Paper, Divider, } from "@material-ui/core";
import { makeStyles , MuiThemeProvider } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import { storiesOf } from "@storybook/react";
import themes from "../../Theme/themes";
import { BrandType } from "../../types/brand";
import TopResume from "../TopResume";

const useStyles = makeStyles((theme) => ({
    root: {
        background: theme.palette.background.default,
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
    darkBg: {
        background: "rgba(0, 0, 0, 0.6)",
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
}));

type TopResumeStoryProps = {
    mode: string,
    brand: BrandType,
    city: string, 
    state: string, 
    country: string, 
    departure: string, 
    arrival: string, 
    pax: number
}

const TopResumeStory = ({
    mode, brand, city, state, country, departure, arrival, pax
}: TopResumeStoryProps) => {
    const classes = useStyles(themes[brand]);

    return (
        <MuiThemeProvider theme={themes[brand]}>
            <Paper className={classes[mode]} id="TopResume">
                <Typography variant="h3">TopResume</Typography>
                <br />
                <Divider />
                <br />
                <TopResume destination={[{city: city, state: state, country: country, departure: departure, arrival: arrival, pax: pax}]} />
            </Paper>
        </MuiThemeProvider>

    );
};

const argsControls = {
    args: {
        brand: "CVC",
        mode: "darkBg",
        city: "Rio de Janeiro", 
        state: "RJ", 
        country: "Brasil", 
        departure: "01/01/2022", 
        arrival: "02/01/2022", 
        pax: 2
    },
    argTypes: {
        brand: {
            type: "select",
            options: ["BlackAndWhite", "BlackFriday", "CVC", "CVCCorp", "CVCYellow", "Sub"]
        },
        mode: {
            type: "select",
            options: ["root", "darkBg"]
        },
        city: {
            label: { type: 'string' },
        },
        state: {
            label: { type: 'string' },
        },
        country: {
            label: { type: 'string' },
        },
        departure: {
            label: { type: 'string' },
        },
        arrival: {
            label: { type: 'string' },
        },
        pax: {
            label: { type: 'number' },
        }
    }
}

storiesOf("Components/TopResume", module).addParameters({ storySource: { source: __STORY__, locationsMap: __LOCATIONS_MAP__ } })
    .add("Default", (args) => <TopResumeStory {...args}/>, argsControls);
